function stripPx(value) {
    var noPx
    if ((value) && (!(value == "initial"))) {
        if (value == "medium") {
            return 1
        } else {
            noPx = value.substring(0, value.length - 2)
            value = parseFloat(noPx)
            if (isNaN(value)) {
                return 0
            } else {
                return value
            }
        }
    } else {
        return 0
    }
}

